    const dtypes = [Function, RegExp, Number, String, Boolean, Object];
    const typesLength = dtypes.length;

    if (typeof value === 'object' || typeof value === 'function') {
        for (let idx = 0; idx < typesLength; idx++) {
            if (value instanceof dtypes[idx]) {
                return dtypes[idx];
            }
        }
    }

