function matrix(n) {
    let m = '';

    for (let i = 0; i < n; i++) {
        for (let j = 0; j < n; j++) {
            if (i === j) {
                m += ' 1 ';
            } else {
                m += ' 0 ';
            }
        }
        m += '\n ---------- \n';
    }
    return m;
}
